import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Signup from './components/Signup';
import Login from './components/Login';
import Dashboard from './components/Dashboard';
import ForgotPassword from './components/ForgotPassword';
// import VerifyCode from './components/VerifyCode';
// import ResetPassword from './components/ResetPassword';
import Home from './pages/Home'; // Home page with dropdown for city-area search
import Results from './pages/Results'; // Results page to display technicians

function App() {
  return (
    <Router>
      <Routes>
        {/* Authentication Routes */}
        <Route path="/signup" element={<Signup />} />
        <Route path="/login" element={<Login />} />
        <Route path="/dashboard" element={<Dashboard />} />
        <Route path="/forgot-password" element={<ForgotPassword />} />
        {/* <Route path="/verify-code" element={<VerifyCode />} /> */}
        {/* <Route path="/reset-password" element={<ResetPassword />} /> */}

        {/* Technician Finder Routes */}
        <Route path="/" element={<Home />} /> {/* Home with dropdowns */}
        <Route path="/results" element={<Results />} /> {/* Search results */}
      </Routes>
    </Router>
  );
}

export default App;
